// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract SealedBidAuction {
    address public auctioneer;
    string public description;
    string public image;
    uint public endTime;
    bool public isCompleted;

    struct Bid {
        bytes32 sealedBid;
        uint deposit;
    }

    mapping(address => Bid) public bids;
    address public highestBidder;
    uint public highestBid;

    event AuctionEnded(address winner, uint amount);

    constructor(
        string memory _description,
        string memory _image,
        uint _endTime
    ) {
        auctioneer = msg.sender;
        description = _description;
        image = _image;
        endTime = _endTime;
        isCompleted = false;
    }

    function placeBid(bytes32 _sealedBid) external payable {
        require(block.timestamp < endTime, "Bidding time has ended");
        bids[msg.sender] = Bid({sealedBid: _sealedBid, deposit: msg.value});
    }

    function revealBid(uint _bidAmount, string memory _secret) external {
        require(block.timestamp >= endTime, "Bidding phase is not over");
        require(!isCompleted, "Auction already ended");

        Bid storage bid = bids[msg.sender];
        require(
            bid.sealedBid == keccak256(abi.encodePacked(_bidAmount, _secret)),
            "Invalid bid reveal"
        );
        require(bid.deposit >= _bidAmount, "Insufficient deposit");

        if (_bidAmount > highestBid) {
            highestBid = _bidAmount;
            highestBidder = msg.sender;
        }

        // Refund excess deposit
        payable(msg.sender).transfer(bid.deposit - _bidAmount);
    }

    function endAuction() external {
        require(block.timestamp >= endTime, "Auction is still ongoing");
        require(!isCompleted, "Auction already ended");

        isCompleted = true;
        emit AuctionEnded(highestBidder, highestBid);

        // Transfer funds to the auctioneer
        payable(auctioneer).transfer(highestBid);
    }
}
